import {
    Button,
    Modal,
    ModalBody,
    ModalCloseButton,
    ModalContent,
    ModalFooter,
    ModalHeader,
    ModalOverlay
} from "@chakra-ui/react";
import {TextField} from "../TextField";

export const AddFriendModal = ({isOpen, onClose}) => {
    return (
        <Modal isOpen={isOpen} onClose={onClose}>
            <ModalOverlay/>
            <ModalContent>
                <ModalHeader>
                    Add a friend
                </ModalHeader>
                <ModalCloseButton/>
                <ModalBody>
                    <TextField>

                    </TextField>
                </ModalBody>
                <ModalFooter>
                    <Button colorScheme={"blue"} onClick={onClose} type={"submit"}>
                        Submit
                    </Button>
                </ModalFooter>
            </ModalContent>
        </Modal>
    );
};
